import React from 'react'
import './App.css';


export default function FormButton({ Title, Data, Color}) {

  const TableContainer = {
    width: 180, 
    height: 250,
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: 'rgba(52, 52, 52, 0)',
    borderRadius: 10,
    border: "3px solid #a93634",
    margin: 10,
  }

  const HeaderContainer = {
    backgroundColor: Color == undefined ? '#a93634' : Color,
    padding: 10,
    fontWeight: 'bold',
    fontSize: 16,
  }
  const BodyContainer = {
    padding: 3,
  }
  const Text1 = {
    fontWeight: 'bold',
    fontSize: 12,
  }
  const Text2 = {
    fontSize: 10,
    flexDirection: 'row',
  }

  return (

    <div style={TableContainer}>
        <div style={HeaderContainer}>
            {Title}
        </div>
        <div>

        <div style={BodyContainer}>
          {Data == undefined ? null : Data.map(element => {
                      return(
                          <div>
                            <div style={Text1}>
                                {element.Product.name + ' | ' + element.time + ' | ' + element.rtTime}
                            </div>
                            <div style={Text2}>
                                {element.time + (element.rtTime === element.time ? '' : '+2')}
                                test
                            </div>
                        </div>

                      )
                    })}
        </div>

        </div>
    </div>
  )
}
